css:
atom-text-editor,
:host {
  background-color: #131313;
  color: #d5d9d5;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #d5d9d5;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #f75404;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f75404;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #d5d9d5;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #404349;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #069ca6;
}
.keyword {
  color: #1488ad;
}
.keyword.control {
  color: #d10386;
  font-weight: bold;
}
.keyword.control.import {
  color: #1488ad;
}
.keyword.operator {
  color: #d10386;
  font-weight: bold;
}
.keyword.other.special-method {
  color: #1488ad;
}
.keyword.other.unit {
  color: #f75404;
}
.keyword.sql {
  color: #f75404;
}
.storage {
  color: #d10386;
  font-weight: bold;
}
.storage.todo {
  color: #40e0d0;
}
.constant {
  color: #dda0dd;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #9d52f7;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #78dc0f;
}
.variable {
  color: #ffff03;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #d5d9d5;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #131313;
}
.string {
  color: #f75404;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #f75404;
}
.string.other.link {
  color: #f75404;
}
.punctuation.definition.comment {
  color: #069ca6;
}
.punctuation.definition.string {
  color: #f75404;
}
.punctuation.definition.variable {
  color: #d10386;
  font-weight: bold;
}
.punctuation.definition.parameters,
.punctuation.definition.array,
.punctuation.definition.arguments {
  color: #d5d9d5;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #1488ad;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #9d52f7;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #969896;
}
.support.class {
  color: #78dc0f;
}
.support.function {
  color: #78dc0f;
}
.support.function.any-method {
  color: #78dc0f;
}
.entity.name.function {
  color: #78dc0f;
  font-weight: bold;
}
.entity.name.type {
  color: #78dc0f;
  font-weight: bold;
}
.entity.other.inherited-class {
  color: #8abeb7;
}
.entity.name.class,
.entity.name.type.class {
  color: #78dc0f;
  font-weight: bold;
}
.entity.name.section {
  color: #1488ad;
}
.entity.name.tag {
  color: #d10386;
  font-weight: bold;
}
.entity.other.attribute-name {
  color: #65d7fd;
}
.meta.class {
  color: #d5d9d5;
}
.meta.link {
  color: #65d7fd;
}
.meta.require {
  color: #1488ad;
}
.meta.selector {
  color: #78dc0f;
}
.meta.separator {
  background-color: #373b41;
  color: #d5d9d5;
}
.meta.function-call {
  color: #78dc0f;
}
.meta.function-call.arguments {
  color: #d5d9d5;
}
.none {
  color: #d5d9d5;
}
.markup.bold {
  color: #f75404;
  font-weight: bold;
}
.markup.changed {
  color: #9d52f7;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #9d52f7;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #1488ad;
}
.markup.inserted {
  color: #78dc0f;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #f75404;
}
.markup.raw.inline {
  color: #78dc0f;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #78dc0f;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
